'''
Given two strings s and p, return an array of all the start indices of p's anagrams in s. You may return the answer in any order.

An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.

 

Example 1:

Input: s = "cbaebabacd", p = "abc"
Output: [0,6]
Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".
Example 2:

Input: s = "abab", p = "ab"
Output: [0,1,2]
Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".
 

Constraints:

1 <= s.length, p.length <= 3 * 104
s and p consist of lowercase English letters.


#
- iterate through substring of p length

- create list to capture indices of the beginning of each substring
- index = 0
- for substring in string
    - create is_substring flag set to True
    - for letter in p 
        - if letter not in substring
            - is_substring
    
    if is_substring:
        - list.append(index)
    index += 1
    return list
'''
from typing import List
from collections import Counter


def find_anagrams(anagram_string: str, p: str )-> List:
    anagram_list = []
    hash_p = Counter(p)
    index = 0
    # iterate through string
    while index <= len(anagram_string) - len(p):
        # substring of length p
        substring = Counter(anagram_string[index: index + len(p)])
        # flag to determine if substring is anagram
        is_substring = True
        
        if substring != hash_p:
            is_substring = False
        if is_substring:
            anagram_list.append(index)
        index += 1
        
    return anagram_list
    

def test_one():
    assert find_anagrams("cbaebabacd", "abc" ) == [0,6]

def test_two():
    assert find_anagrams("abab", 'ab') == [0,1,2]

def test_wtf_leetcode():
    # tmie limit exceeded - need to remove the sort
    assert find_anagrams("", "" )